import { Box, Typography } from '@mui/material'
import Layout from '../Components/Layout/Layout'
import chicken from '../images/imgcontact.jpg'

function Contact() {
  return (
    <Layout>
      <Box>
        <div style={{
          backgroundImage: `url(${chicken})`, minHeight: '500px',
          textAlign: 'center', backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat'
         }}>
          <div style={{ margin: '100px,0' }}>
            <Typography variant='h4'
              sx={{
                color: 'white', bgcolor: 'black',
                textAlign: 'center', margin: '0 400px'
              }}>We would love to hear from you!</Typography>
          </div>
          </div >
      </Box>
    </Layout>
  )
}

export default Contact
